import React from 'react';
import './App.css';
import Navigation from './components/Navigation';
import Logo_mpt from './components/Logo_mpt';
import Menu_principal from './components/Menu_principal';
import Inicio_mpt from './components/Inicio_mpt';
import SimplePaper from './components/Pruebas';
import Item_1 from './Pruebas/Item_1';
import Item_2 from './Pruebas/Item_2';
function App() {
  return (
    <div className="App">

      <Navigation></Navigation>
      {/* <Menu_principal></Menu_principal> */}
      <SimplePaper></SimplePaper>
      <Inicio_mpt></Inicio_mpt>
      <Item_1></Item_1>
      <Item_2></Item_2>

      <Logo_mpt></Logo_mpt>


    </div>
  );
}

export default App;
